interface Props{

}
export default function Time(props: Props){
    const Times = [
        undefined,
        15,
        30,
        45,
        60
    ]
    return (
        <>
            <InputLabel id="demo-simple-select-label">eifj</InputLabel>
            <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            label="Age"
            onChange={handleChange}
            ></Select>
            <select className="h-8 time-dropdown" title="time" name="time">
                {Times.map((time: number | undefined)=>{
                    return (
                        time ? 
                        <option value="">{time}</option>
                         : 
                        <option value="">No Limit</option>
                    )
                })}
            </select>
        </>
    )
}
